import TodoList from "./components/TodoList";
import Todo from "./components/Todo";

const todos = ["Buy milk", "Pay rent", "Go to the bank"];

export default function App() {
    return (
        <TodoList>
            {todos.map((todo, i) => (
                <Todo key={i}>{todo}</Todo>
            ))}
        </TodoList>
    );
}
